import csv
import numpy as np
import pandas as pd
from sklearn import metrics
from sklearn.metrics import precision_recall_fscore_support

def file_combine(Input_filepath1, Iutput_filepath2, Output_filepath):
    #df1 = pd.DataFrame(pd.read_csv(Input_filepath1, header=None, index_col=False))
    #df2 = pd.DataFrame(pd.read_csv(Iutput_filepath2, header=None, index_col=False))
    df1 = pd.DataFrame(pd.read_csv(Input_filepath1))
    df2 = pd.DataFrame(pd.read_csv(Iutput_filepath2))
    result_file = pd.concat([df1, df2], axis=1)
    np.savetxt(Output_filepath, result_file, delimiter=',')
    return Output_filepath

"""将训练集的Score按照Normal和Abnormal进行分组"""
def score_seperate(Input_filepath, Output_filepath):

    with open(Input_filepath, 'r') as csvfile:
        reader = csv.DictReader(csvfile)
        column_score = [row['score'] for row in reader]

    with open(Input_filepath, 'r') as csvfile:
        reader = csv.DictReader(csvfile)
        column_lable = [row['lable'] for row in reader]

    length = len(column_lable)
    list_N = []
    list_A = []

    for i in range(0, length):
        if column_lable[i] == '0':
            list_N.append(column_score[i])
        else:
            list_A.append(column_score[i])

    file_N = pd.DataFrame({'N': list_N})
    file_N.to_csv(Output_filepath,index=False)
    file_A = pd.DataFrame({ 'A': list_A})
    file_A.to_csv(Output_filepath,index=False)

    return Output_filepath

"""p_value 计算函数"""
def p_value(value,list, number):
    count = 0.0
    for i in range(len(list)):
        if value <= list[i]:
            count = count + 1
    p_value = float(1.0-count/(number+1))
    if p_value > 1:
        p_value = 1
    else:
        p_value = p_value
    return p_value

"""计算每条test日志的p_value和confidence,并打上相应的label"""
def p_value_file(Input_filepath1, Input_filepath2, Output_filepath):

    with open(Input_filepath1, 'r') as csvfile:
        reader = csv.DictReader(csvfile)
        column_N = [row['N'] for row in reader]
    list_N = map(float, column_N)
    column_sort_N = sorted(list_N,reverse=True)
    number_N = len(column_sort_N)

    with open(Input_filepath1, 'r') as csvfile:
        reader = csv.DictReader(csvfile)
        column_A = [row['A'] for row in reader]
    while '' in column_A:
        column_A.remove('')
    list_A = map(float, column_A)
    column_sort_A = sorted(list_A,reverse=True)
    number_A = len(column_sort_A)

    with open(Input_filepath2, 'r') as csvfile:
        reader = csv.DictReader(csvfile)
        column_score = [row['score'] for row in reader]
    list_S = map(float, column_score)
    row_length = len(list_S)

    column_length = 5

    distMat = np.zeros((row_length, column_length))
    for i in range(0, row_length):
        test_scores = list_S[i]
        n_p_value = p_value(test_scores, column_sort_N, number_N)
        a_p_value = p_value(test_scores, column_sort_A, number_A)
        distMat[i][0] = n_p_value
        distMat[i][1] = a_p_value
        if n_p_value>a_p_value:
            distMat[i][2] = n_p_value
            distMat[i][3] = (1.0-a_p_value)
            distMat[i][4] = 0
            if distMat[i][3] >= 0.5:
                distMat[i][4] = 0
            else:
                distMat[i][4] = 1

        elif n_p_value<a_p_value:
            distMat[i][2] = a_p_value
            distMat[i][3] = (1.0 - n_p_value)
            distMat[i][4] = 1
            if distMat[i][3] >= 0.5:
                distMat[i][4] = 1
            else:
                distMat[i][4] = 0
            #distMat[i][4] = 1

    np.savetxt(Output_filepath, distMat, delimiter=',')
    return Output_filepath

"""模型预测"""
def metrics(y_pred, y_true):
    precision, recall, f1, _ = precision_recall_fscore_support(y_true, y_pred, average='binary')
    return precision, recall, f1

